  true,\n\t\"url\": null,\n\t\"notes\": \"The SeaWiFS instrument was launched by Orbital
  Sciences Corporation on the OrbView-2n(a.k.a. SeaStar) satellite in August 1997,
  and collected data from September 1997 untilnthe end of mission in December 2010.
  SeaWiFS had 8 spectral bands from 412 to 865 nm.nIt collected global data at 4 km
  resolution, and local data (limited onboard storagenand direct broadcast) at 1 km.
  The mission and sensor were optimized for ocean colornmeasurements, with a local
  noon (descending) equator crossing time orbit, fore-and-aftntilt capability, full
  dynamic range, and low polarization sensitivity.\",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
